import React from "react";
import Personal from "./Personal";

const Preview = () => {
    let personal = new Personal();
    let getPersonalArr = personal.state.PersonalInfo;
    console.log(getPersonalArr);

    const listItems = getPersonalArr.map((personalInfo) =>
        <div key={personalInfo.id}>{personalInfo.name}{personalInfo.email}{personalInfo.phone}</div>
    );


    return (
        <ul>{listItems}</ul>
    )
}


export default Preview;
